import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Click on the followers count in the profile modal
    await page.waitForSelector('#profileModal'); // Wait for the profile modal to be visible
    await page.waitForSelector('.stats span:contains("followers")'); // Wait for the followers count
    await page.click('.stats span:contains("followers")'); // Click on the followers count

    // Wait for the user list modal to open
    await page.waitForSelector('#userListModal'); // Wait for the user list modal to be visible

    // Take a screenshot after the user list modal opens
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_user_list_modal.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_user_list_modal.png'));

    // Verify that the user list modal is open
    const isUserListModalVisible = await page.isVisible('#userListModal');

    return {
      success: true,
      action: "Clicked on followers count and verified user list modal opened",
      extractedData: { isUserListModalVisible },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

